COPY public.operator_operatorfaq (id, title, description, operator_id) FROM stdin;
5	Subscription	<p><strong><span style="color:black">a) How do I subscribe to MTN Engage</span></strong></p>\r\n\r\n<p><span style="color:black">There are 3 ways to subscribe:</span></p>\r\n\r\n<ol>\r\n\t<li><span style="color:black">Send &ldquo;1&rdquo; to the short code &ldquo;XXXX&rdquo; to subscribe for N30 daily. </span></li>\r\n\t<li><span style="color:black">Send &ldquo;2&rdquo; to the short code &ldquo;XXXX&rdquo; to subscribe for N50 daily.</span></li>\r\n\t<li><span style="color:black">Send &ldquo;3&rdquo; to the short code &ldquo;XXXX&rdquo; to subscribe for N100 daily.</span></li>\r\n</ol>\r\n\r\n<p><strong><span style="color:black">b) What are the subscriptions rates and benefits? </span></strong></p>\r\n\r\n<ol>\r\n\t<li><span style="color:black">Free: Get access to several games, earn coins, redeem coins for prizes.</span></li>\r\n\t<li><span style="color:black">N30: One day access to play any one game. Earn and redeem coins. Prizes include Cash, Data, Vouchers, Films, Stickers and many others.</span></li>\r\n\t<li><span style="color:black">N50 for one day access to play all games. Earn and redeem coins. Prizes include Cash, Data, Vouchers, Films, Stickers and many others. </span></li>\r\n\t<li><span style="color:black">N100 for one day access to play all games. Earn and redeem coins. Prizes are the biggest on offer and include Cash, Data, Vouchers, Films, Stickers and many others. </span></li>\r\n</ol>\r\n\r\n<p><strong><span style="color:black">c) How do I unsubscribe? </span></strong></p>\r\n\r\n<p><span style="color:black">Send STOP to (short code) to unsubscribe. However, you will lose all your coins and levels you have earned to date and you will lose your rights to play any tournaments that offer Cash and other valuable prizes. </span></p>\r\n\r\n<p><strong><span style="color:black">d) Do I lose my coins and levels if I unsubscribe? </span></strong></p>\r\n\r\n<p>No, progression gained in the MTN Daily Missions section will be lost, the advantages and benefits you gain through subscription is halted.</p>\r\n\r\n<p><strong><span style="color:black">e) Can I upgrade from free to premium? </span></strong></p>\r\n\r\n<p>Yes, the option is always available to upgrade at any time.</p>	1
4	About MTN Engage	<p><strong>a) What is MTN Engage?</strong></p>\r\n\r\n<p>MTN Engage is a casual and competitive games platform that connects video gamers, allowing them to compete and enjoy their time playing their favorite games for cash and prizes. There are no chance winners, you win by competing. We want gamers to have fun and win rewards.</p>\r\n\r\n<p><strong>b) What games does MTN Engage have?</strong></p>\r\n\r\n<p><strong>c) What are the prizes and rewards you offer?</strong></p>	3
1	About MTN Engage	<p>Engage App is an innovative and trendy eSports Tournament Platform offering MTN&nbsp;subscribers access to multiple premium and competitive games in a single and consolidated platform with daily tournaments and prizes for participants. It offers premium and user-friendly access to competitive gaming platforms which are selected based on the top gaming charts including PUBG, FIFA 2021, Mobile Legend, premium games, and many others.</p>\r\n\r\n<p>Engage is subscription based product&nbsp;offering free and premium categories to end users with many competitve models. Users can choose any package to opt-in and can upgrade later on their subscription to unlock many premium features.</p>	1
6	Games and Tournaments	<p><strong><span style="color:black">a) What games does MTN Engage have?</span></strong></p>\r\n\r\n<p>MTN Engage has hundreds of games for you to play. There are leisure games for free users (Link required), Games subscribers can play (Link required) and Competitive games all users can play (Link required), however, only subscribed users can compete in tournaments that offer Cash and other valuable prizes.</p>\r\n\r\n<p>The reward tracks are connected to most major games available for all users, including but not limited to:</p>\r\n\r\n<ol>\r\n\t<li>Player Unknown Battlegrounds (Pubg)</li>\r\n\t<li>Call of Duty Mobile</li>\r\n\t<li>Asphalt 9</li>\r\n\t<li>Clash Royale</li>\r\n\t<li>Clash of Clans</li>\r\n\t<li>Leage of Legends</li>\r\n\t<li>Need for Speed - No Limits</li>\r\n\t<li>Mobile Legends</li>\r\n\t<li>Fifa Mobile</li>\r\n\t<li>Free Fire</li>\r\n</ol>\r\n\r\n<p><strong><span style="color:black">b) How do I register for a tournament?</span></strong></p>\r\n\r\n<p>Once you become a subscriber, you gain access to tournaments from the tournament selection page as advertised on the home page or from selecting from the list provided within the profile section. You will be notified to the exact date and time to the tournament you have registered for.</p>\r\n\r\n<p><strong><span style="color:black">c) When do I begin playing the tournament I registered for?</span></strong></p>\r\n\r\n<p><span style="color:black">You will be sent a notification link as a text message and the same notification within MTN Engage. Click on any one of the notifications and you will begin the tournament.</span></p>	1
8	MTN Engage Coins	<p><strong><span style="color:black">a) What are MTN Engage Coins? </span></strong></p>\r\n\r\n<p>Engage coins are used to redeem rewards from the engage platform by accessing this section (Linked to Redeem coins)</p>\r\n\r\n<p><strong><span style="color:black">b) How do I Earn coins?</span></strong></p>\r\n\r\n<p>Coins can be won through a variety of ways:</p>\r\n\r\n<ul>\r\n\t<li>By playing games.</li>\r\n\t<li>Taking part in the prestige system, through entering tournaments.</li>\r\n\t<li>By completing daily missions.</li>\r\n\t<li>By watching a video.</li>\r\n\t<li>By inviting friends to join the app.</li>\r\n\t<li>Through direct purchase through the in-app store.</li>\r\n</ul>\r\n\r\n<p><strong><span style="color:black">c) How do I buy coins?</span></strong></p>\r\n\r\n<p><span style="color:black">Go to the redeem coins section (link required), Buy Coins, and select your preferred package. </span></p>\r\n\r\n<p><strong><span style="color:black">d) How do I redeem coins? </span></strong></p>\r\n\r\n<p>Engage coins are used to redeem rewards from the engage platform by accessing this section (Linked to Redeem coins)</p>\r\n\r\n<p><strong><span style="color:black">e) Can I transfer my coins to another player? </span></strong></p>\r\n\r\n<p>Yes, you can transfer your coins to another user who is on your friends list.</p>	1
7	Prizes and Rewards	<p><span style="color:black"><strong>a) What are the prizes and rewards you offer?</strong></span></p>\r\n\r\n<p>There are a wide variety of <u>prizes</u> (have this linked to our prizes page) on offer, ranging from Cash and Data packages to promotional events and holiday prizes, take part and win fantastic prizes through skill and perseverance.</p>\r\n\r\n<p><strong><span style="color:black">b) How do I claim my rewards?</span></strong></p>\r\n\r\n<p>Cash prizes will directly be transferred through given channels, Account rewards and coins will be transferred through user accounts and physical rewards will be through reaching out to the user either by e-mail or phone number.</p>\r\n\r\n<p><strong><span style="color:black">c) Can I transfer my coins to another player? (Linked to 5d)</span></strong></p>\r\n\r\n<p>Yes, you can transfer your coins to another user who is on your friends list.</p>\r\n\r\n<p><strong><span style="color:black">d) What are the prizes and rewards? </span></strong></p>\r\n\r\n<p><span style="color:black">We offer several prizes and rewards all year round. They range from Cash when playing and winning tournaments, to Vouchers and Stickers, Movies, Music and Tv Shows. </span></p>\r\n\r\n<p><span style="color:black">In 2022, we will be offering all-paid trips to watch the FIFA World Cup 2022 in Qatar, Electronics, Motor Bikes and many valuable prizes.</span></p>	1
\.
